import React from "react";
import Slider from "react-slick";
import Rugby from "../Rugby"
import Content from '../components/Content'

export default function SimpleSlider() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
       <div className="dictionary">
       {Rugby.map((props) => (
           <Content
               image={props.image}
           />
       ))}
       </div>
    </Slider>
  );
}
